  {
    id: "1",
    LinkName: "Task1",
    LinkPath: ROUTE_CONSTANTS.TASK1,
  },
  {
    id: "2",
    LinkName: "Task2",
    LinkPath: ROUTE_CONSTANTS.TASK2,
  },
];
